const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d', { willReadFrequently: true });
let particlesArray = [];
let grid = [];
const detail = 1;

canvas.width = window.innerWidth;
canvas.height = window.innerHeight;

const image = new Image();

//goldenLeaves_base64
