// golden leaves jpg
image.src = 'art/goldenLeavesSmaller.jpg';

//guitar image
// image.src = 'art/guitar.png';

function init() {
  const numberOfParticles = 5000;
  for (let i = 0; i < numberOfParticles; i++) {
    particlesArray.push(new Particle());
  }
}

function calculateBrightness(red, green, blue) {
  return Math.sqrt(
    (red * red) * 0.299 +
    (green * green) * 0.587 +
    (blue * blue) * 0.114
  );
}

function createGrid(pixels) {
  grid = [];  // Clear the old grid
  for (let y = 0; y < canvas.height; y += detail) {
    let row = [];
    for (let x = 0; x < canvas.width; x += detail) {
      const red = pixels.data[(y * 4 * pixels.width) + (x * 4)]
      const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)]
      const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)]
      const color = 'rgb(' + red + ',' + green + ',' + blue + ')';
      const brightness = calculateBrightness(red, green, blue) / 100;
      const cell = [
        cellColor = color,
        cellBrightness = brightness,
      ];
      row.push(cell);
    }
    grid.push(row);
  }
  return grid;
}

function animate() {
  ctx.globalAlpha = 0.05;
  ctx.fillStyle = 'rgb(0, 0, 0)';
  ctx.fillRect(0, 0, canvas.width, canvas.height);
  ctx.globalAlpha = 0.2;
  let particlesToRemove = [];
  for (let i = 0; i < particlesArray.length; i++) {
    if (particlesArray[i]) {
      particlesArray[i].update();
      // If the particle is out of bounds, mark it for removal
      if (particlesArray[i].x < 0 || particlesArray[i].x > canvas.width || particlesArray[i].y < 0 || particlesArray[i].y > canvas.height) {
        particlesToRemove.push(i);
      } else {
        ctx.globalAlpha = particlesArray[i].speed * 0.3;
        particlesArray[i].draw();
      }
    }
  }
  // Remove all particles that were marked for removal
  for (let i = particlesToRemove.length - 1; i >= 0; i--) {
    particlesArray.splice(particlesToRemove[i], 1);
  }
  requestAnimationFrame(animate);
}

class Particle {

  constructor() {
    this.x = Math.random() * canvas.width;
    this.y = canvas.height;
    //this.prevX = this.x;
    this.speed = 0;
    this.velocity = Math.random() * 0.2;
    this.size = Math.random() * 2 + 0.5;
    this.position1 = Math.floor(this.y / detail);
    this.position2 = Math.floor(this.x / detail);
    this.angle = 0;
  }

  update() {
    if (this.x < 0 || this.x > canvas.width || this.y < 0 || this.y > canvas.height) {
      // Particle has moved off the canvas, reset its position and speed
      this.x = Math.random() * canvas.width;
      this.y = canvas.height;
      this.speed = 0;
    } else {
      // Normal movement and speed calculations
      this.position1 = Math.floor(this.y / detail);
      this.position2 = Math.floor(this.x / detail);
      if (grid[this.position1]) {
        if (grid[this.position1][this.position2]) {
          this.speed = grid[this.position1][this.position2][1];
        }
      }
      this.angle += this.speed / Math.random(50);
      let movement = (2.5 - this.speed) + this.velocity;
      this.y -= movement + Math.cos(this.angle) * 0.5;
      this.x += Math.cos(this.angle) * 0.5;
      if (this.y <= 0) {
        this.y = canvas.height;
        this.x = Math.random() * canvas.width;
      }
    }

  }

  draw() {
    ctx.beginPath();
    ctx.fillStyle = 'white';
    if (this.y > canvas.height - this.size * 6) ctx.globalAlpha = 0;
    if (grid[this.position1]) {
      if (grid[this.position1][this.position2]) {
        ctx.fillStyle = grid[this.position1][this.position2][0];
      }
    } else {
      ctx.fillStyle = 'yellow';
    }
    ctx.arc(this.x, this.y, this.size, 0, 2 * Math.PI);
    ctx.fill();
  }
}

function debounce(func, wait) {
  let timeout;
  return function executedFunction(...args) {
    const later = () => {
      clearTimeout(timeout);
      func(...args);
    };
    clearTimeout(timeout);
    timeout = setTimeout(later, wait);
  };
}

window.addEventListener('resize', debounce(function () {
  canvas.width = window.innerWidth;
  canvas.height = window.innerHeight;

  let offscreenCanvas = document.createElement('canvas');
  offscreenCanvas.width = canvas.width;
  offscreenCanvas.height = canvas.height;
  let offscreenCtx = offscreenCanvas.getContext('2d');

  offscreenCtx.drawImage(image, 0, 0, offscreenCanvas.width, offscreenCanvas.height);
  const pixels = offscreenCtx.getImageData(0, 0, offscreenCanvas.width, offscreenCanvas.height);
  offscreenCtx.clearRect(0, 0, offscreenCanvas.width, offscreenCanvas.height);

  let grid = createGrid(pixels);

  // re-initialize the particles
  particlesArray = [];
  init();

  animate();

}, 200));

image.addEventListener('load', function () {

  let offscreenCanvas = document.createElement('canvas');
  offscreenCanvas.width = canvas.width;
  offscreenCanvas.height = canvas.height;
  let offscreenCtx = offscreenCanvas.getContext('2d');

  offscreenCtx.drawImage(image, 0, 0, offscreenCanvas.width, offscreenCanvas.height);
  const pixels = offscreenCtx.getImageData(0, 0, offscreenCanvas.width, offscreenCanvas.height);
  offscreenCtx.clearRect(0, 0, offscreenCanvas.width, offscreenCanvas.height);

  let grid = createGrid(pixels);

  init();

  animate();
});

document.querySelectorAll('#navbar .nav-link').forEach((navLink) => {
  navLink.addEventListener('click', (e) => {
    // e.preventDefault();

    // Hide all text
    document.querySelectorAll('.text').forEach((text) => {
      text.style.display = 'none';
      text.style.opacity = '0';
    });

    // Show the text that corresponds to the clicked button
    let textId = 'text' + e.target.id;
    let selectedText = document.getElementById(textId);
    selectedText.style.display = 'block';
    setTimeout(() => { // Timeout for smooth transition
      document.getElementById(textId).style.opacity = '1';
    }, 50);
  });
});